import './App.css';
import { Spinner } from 'reactstrap';

function App() {
  return (
    <div className="App">
      <div id="pre-loader">
        <Spinner color="info" style={{ width: '3em', height: '3em' }} />
        <p className="sub-title">christopher robin reynolds</p>
      </div>
      <div id="loaded">
        <h1>Content</h1>
      </div>
    </div>
  );
}

export default (App);
